Всем привет! На этот раз :motor_scooter: мой :slightly_smiling_face:
*Название*: руководитель направления исследования данных
*Место*: Москва, ст.м. Технопарк, Альфа-Банк
*TL/DR*: Собираю небольшую, но боевую команду data scientists для работы с новыми источниками, улучшения старых моделей и создания новых для зарабатывания большого количества денег.
*Что предстоит делать* (лично, без делегирования):
- анализировать новые источники данных, проводить очистку данных и генерацию признаков, быстро строить предсказательные модели на разнородных источниках;
- осуществлять реализацию и сопровождение многоуровневых архитектур вероятностных моделей, качественно документировать процесс разработки и готовые решения;
- принимать активное участие в развитии команды: от code review до solution review, внедрять лучшие практики, участвовать во внутренних мероприятиях (хакатонах), выступать на митапах, быть примером для подражания :slightly_smiling_face:
*Пожелания к кандидатам*:
- высокий скилл и подтверждённые навыки решения задач в области машинного обучения с доказанным практическим эффектом;
- наличие профильного или околопрофильного высшего образования (физико-математическое, техническое);
- знание Python (scipy, scikit-learn, xgboost и др.), SQL;
- владение стеком Hadoop (как минимум, Hive, но Spark тоже пригодится);
- технический английский (но лучше разговорный);
- развитые soft skills: коммуникабельность, умение решать поставленные задачи в срок, внимание к деталям и способность быстро учиться (предметная область специфична);
- опыт работы в сфере анализа данных - от 2 лет.
*Не обязательно, но будет здорово, если имеются* (в порядке убывания значимости):
- результаты участия в конкурсах по анализу данных, которые не стыдно предъявить (:kaggle:-master, например);
- опыт работы и моделирования в банковской и/или финансовой сфере;
- опыт руководства командой от 1 человека и более, не считая себя (со всеми вытекающими отсюда обстоятельствами в смысле функционального управления);
- культура ведения работ в Jira/Stash/Confluence и понятия о гибких методологиях разработки;
- опыт использования GAM, использования методов обнаружения аномалий. 
*Компенсация*: з/п от 200 тысяч рублей в месяц (это левая граница «вилки»), годовой бонус.
